import classes from './Bodyforsellingpage.module.css';
import logo from '../../assests/Logo.png';
import { useFormik } from "formik";


const Bodyforsellingpage = () => {
    
    const formik = useFormik({          // the useFormik hook takes in object and returns object.
        initialValues: {
            Category: "",       // name from input fiels
            Name: "",
            Price: 0,
            Date: "",
            myFile: "",
            Description: "",
            Negotiation: ""
        },
        onSubmit: (values) => {
            console.log(values);
            fetch('http://localhost:4000/ad-api/postAd', {
                method: "POST",
                headers: {
                    'Content-Type': 'application/json'
                },
                body: JSON.stringify({
                    values
                })
            })
        }
    });

    // console.log(formik.values);      // logs in values at every change in any input.

    function Handlereset(){
        if(window.confirm("Are you sure you want to Reset?")){
            formik.handleReset();
        }
    };

    return (
        <div className={classes.main}>
            <div className={classes.image}>
                <img src={logo} width={50} height={50} alt="logo"/>
            </div>
            <p className={classes.title}>
                Post Your Ad
            </p>
            <div>
                <form className={classes.form} action='results.html' method='POST' encType='multipart/form-data' onSubmit={formik.handleSubmit}>
                    <div>
                        <label htmlFor='Category'>Choose Category : </label>
                        <input 
                        className={classes.input} 
                        list='categories' 
                        id='Category' 
                        name='Category' 
                        required 
                        onChange={formik.handleChange}
                        value={formik.values.Category}/>
                        <datalist id='categories'>
                            <option value="mobiles">Mobiles</option>
                            <option value="Laptops">Laptops</option>
                            <option value="Cycles">Cycles</option>
                            <option value="Mattresses">Mattresses</option>
                            <option value="Others">Others</option>
                        </datalist>
                    </div>
                    <div>
                        <label htmlFor='Name'>Product Name : </label>
                        <input 
                        className={classes.input} 
                        type='text' 
                        name='Name' 
                        id='Name' 
                        required 
                        onChange={formik.handleChange}
                        value={formik.values.Name}/>
                    </div>
                    <div>
                        <label htmlFor='Price'>Price : â‚¹</label>
                        <input 
                        className={classes.input} 
                        type='number' 
                        id='Price' 
                        name='Price' 
                        required 
                        min='1'
                        onChange={formik.handleChange}
                        value={formik.values.Price} />
                    </div>
                    <div>
                        <label htmlFor='Date'>Date of Buying</label>
                        <input 
                        className={classes.input} 
                        type='date' 
                        id='Date' 
                        name='Date' 
                        required
                        onChange={formik.handleChange}
                        value={formik.values.Date}/>
                    </div>
                    <div>
                        <label htmlFor='myfile'>Upload Photo : </label>
                        <input 
                        className={classes.input} 
                        type='file' 
                        id='myfile' 
                        name='myfile' 
                        onChange={formik.handleChange}
                        value={formik.values.myFile}/>
                    </div>
                    <div>
                        <label htmlFor='description'>Product Description : </label>
                        <textarea 
                        rows='10' 
                        cols='30' 
                        placeholder='Briefly describe your product...' 
                        required id='description' 
                        name='Description'
                        onChange={formik.handleChange}
                        value={formik.values.Description}></textarea>
                    </div>
                    <div>
                        <input 
                        className={classes.input} 
                        type='checkbox' 
                        id='Negotiation' 
                        name='Negotiation' 
                        required 
                        onChange={formik.handleChange}
                        value={formik.values.Negotiation}/>
                        <label htmlFor='Negotiation'> Negotiable</label>
                    </div>
                    <div>
                        <button className={classes.reset} type='reset' id="resetbtn" onClick={Handlereset}>Reset</button>
                        <button className={classes.submit} type='submit'>PostAd</button>
                    </div>
                    
                </form>
            </div>
        </div>
    );
}
 
export default Bodyforsellingpage;
